import React from 'react';
import ReactDOM from 'react-dom';


const name = "Samarth";
const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/250/300";
const img3 = "https://picsum.photos/300/300";
const img4 = "https://picsum.photos/200/350";
const Link1= "https://www.google.com/webhp?hl=en&ictx=2&sa=X&ved=0ahUKEwjE1q_kzYiAAxVha2wGHYmNAC8QPQgJ";

const heading = {color:'#fa9191',
                 textTransform:'capitalize',
                 textAlign:'center',
                 textShadow: '0px 2px 4px #ffe9c5',
                 fontWeight: 'bold',
                 margin:'70px '
};

ReactDOM.render(<>
    <h1 style={heading}> My name is {name} </h1>
    <div className='img_div'>
    <img alt='randomImage' src={img1}/>
    <img alt='randomImage' src={img2}/>
    <img alt='randomImage' src={img3}/>
    <a href={Link1} target='_Samarth'>
    <img alt='randomImage' src={img4}/>
    </a>
    </div></>   
    ,document.getElementById('root')
);
